import React, { Component } from 'react'

export default class List extends Component {
    render() {
        return (
            <ul>
                <label>
                    <input type="checkbox"/>
                    <span>xxxxxx</span>
                </label>
                <button className="btn btn-danger" style={{di}}>删除</button>
            </ul>
        )
    }
}
